import React, { Component } from 'react'

class ConRendering extends Component {

    constructor(props) {
        super(props)
    
        this.state = {
             isLogedIn: true
        }
    }
    
    render() {
        if(this.state.isLogedIn){
            return <div>Welcome Ak</div>
        } else{
            return <div>Welcome Guest</div>
        }
        
    }
}

export default ConRendering
